    result += y[30]*ums[30]*imw[30]; /*CH3OCH2O */
    result += y[31]*ums[31]*imw[31]; /*CH3OCH2OH */
    result += y[32]*ums[32]*imw[32]; /*OCH2OCHO */
    result += y[33]*ums[33]*imw[33]; /*HOCH2OCO */
