    YOW += y[16]*imw[16]; /*C2H6 */
    YOW += y[17]*imw[17]; /*CH2OH */
    YOW += y[18]*imw[18]; /*CH3O */
    YOW += y[19]*imw[19]; /*O2 */
    YOW += y[20]*imw[20]; /*HO2 */
    YOW += y[21]*imw[21]; /*H2O2 */
    YOW += y[22]*imw[22]; /*CO2 */
    YOW += y[23]*imw[23]; /*CH3HCO */
