    dqdci =  + k_f*sc[25];
    J[205] -= dqdci;              /* dwdot[O]/d[O] */
    J[207] += 2 * dqdci;          /* dwdot[OH]/d[O] */
    J[211] += dqdci;              /* dwdot[CO]/d[O] */
    J[225] -= dqdci;              /* dwdot[HCOOH]/d[O] */
    /* d()/d[OH] */
